def predict(triples: list[Triple]) -> str:
    airport_info = {}
    location_info = {}
    country_info = {}

    for triple in triples:
        if triple.subject not in airport_info:
            airport_info[triple.subject] = []
        if triple.subject not in location_info:
            location_info[triple.subject] = []
        if triple.subject not in country_info:
            country_info[triple.subject] = []

        if triple.predicate == "cityServed":
            airport_info[triple.subject].append(f"serves the city of {triple.object}")
        elif triple.predicate == "location":
            location_info[triple.subject].append(f"is located in {triple.object}")
        elif triple.predicate == "country":
            country_info[triple.object].append(f"{triple.subject} is in {triple.object}")
        elif triple.predicate == "isPartOf":
            location_info[triple.subject].append(f"which is part of {triple.object}")
        else:
            airport_info[triple.subject].append(f"has a {triple.predicate} of {triple.object}")

    sentences = []
    for subject, info in airport_info.items():
        sentence = f"{subject} "
        sentence += ", ".join(info)
        sentences.append(sentence)

    for subject, info in location_info.items():
        if info:
            sentence = " ".join(info)
            sentences.append(sentence)

    for subject, info in country_info.items():
        if info:
            sentence = " ".join(info)
            sentences.append(sentence)

    if sentences:
        return ". ".join(sentences) + "."
    else:
        return ""

